import React, { useEffect, useState } from "react";
import {
  Box,
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
  Modal,
} from "@mui/material";
import { Link, Route, Routes, useParams } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { handleClose } from "../../../features/HandleClickToAppearCheckoutForm";
const Checkingform = () => {
  const dispatch = useDispatch();
  const open = useSelector((state) => state.handleClick.open);

  const HandleClose = () => {
    dispatch(handleClose());
  };
  return (
    <Box className="Container_Form_Check_Infor">
      <Modal open={open} onClose={HandleClose} className="Form_Check_Infor">
        {/* <Box>
          <Card className="cardForm">
            <Box>
              <CardMedia
                component="img"
                alt="Product is selected"
                className="imageCard"
                //Url
              />
              <CardContent>
              <Typography
                 gutterBottom
                 variant="h6"
                 component="div"
                 className="test1"
              >
                  HELLO
              </Typography>
              </CardContent>
            </Box>
            <CardActions>
                <Button>Check out</Button>
            </CardActions>
          </Card>
        </Box> */}
        <Typography variant="h6" component="div" className="test1">
        HELLO
      </Typography>
      </Modal>
    </Box>
  );
};

export default Checkingform;
